    <a> <FontAwesomeIcon icon={faHomeAlt} /> Homepage</a>
    <a> <FontAwesomeIcon icon={faHomeAlt} /> Homepage</a>
    <a> <FontAwesomeIcon icon={faHomeAlt} /> Homepage</a>
    </nav>
      

    </div>

    </div>
  )
};
export default Sidebar
